import React from 'react';

const Optowelt = () => {
    return (
        <div>
           <h1>СООБЩИТЕ КОМАНИЯМ, ЧТО ВАМ НУЖНО</h1>
           <p>Мы разошлем вашу заявку по большой базе поставщиков, они сами свяжутся с вами</p>
        </div>
    );
};

export default Optowelt;
